import React from "react";
import Coverr from "../../img/bg-lang.png";

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + { Coverr } + ")",
};

const Lang = () => {
  return (
    <div className="back" style={sectionStyle}>
      <h1>Hello</h1>
    </div>
  );
};

export default Lang;
